  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0155294 contains raw underway
  meteorological, navigational, optical, physical, profile and time series data logged
  by the Scientific Computer System (SCS) aboard NOAA Ship Pisces in the North Atlantic
  Ocean from 2016-06-08 to 2016-06-25. Office of Marine and Aviation Operations (OMAO)
  personnel aboard the ship submitted these data and associated metadata to NCEI.
  In addition, NCEI Accession 0155294 contains supplementary cruise-level metadata,
  which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NCEI
  personnel developed the automated process to archive these data under the auspices
  of the NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"owner_org\":
